import React , {useState} from "react"
import axiosInstance from "../../../axios";
import {  useNavigate } from "react-router-dom";
import { validEmail, validPassword } from './custom_validation.js';
import './registration.css'
import { ToastContainer, toast } from "react-toastify";


const Registration = () => {

    const navigate = useNavigate();

    const initialFormData = Object.freeze({
        email: '',
        first_name: '',
        last_name: '',
        address: '',
        address2: '',
        phone:'',
        password: '',
        
    })

    const [formData, setFormData] = useState(initialFormData)
    const [errorEmail, setErrorEmail] = useState(false)
    const [errorPassword, setErrorPassword] = useState(false)



    const validateData = (email, password) => {

         if (!validEmail.test(email)) {
            setErrorEmail(true);
            console.log("error_email")
         }
         if (!validPassword.test(password)) {
            setErrorPassword(true);
            console.log("error_password")
         }
    }

    const handleChange = e => {
        
        console.log(e.target.value)
        setFormData({
            ...formData,[e.target.id]: e.target.value
        })
    }

    const handleSubmit = e => { 
        e.preventDefault();
       
        validateData(e.target[0].value, e.target[6].value)
      
        axiosInstance 
            .post(`http://127.0.0.1:8000/api/user/register/`, {
                email: formData.email,
                first_name: formData.first_name,
                last_name: formData.last_name,
                address: formData.address,
                address2: formData.address2,
                phone: formData.phone,
                password: formData.password

            })
             
        
            .then((res) => { 
              
                navigate('/')
              
               
            }) 
          


    }

    const sendWelcomeMsg = message =>  toast.success(`${message}`, {

        
      position: "top-right",
      autoClose: 3000,
      hideProgressBar: false,
      closeOnClick: true,
      pauseOnHover: true,
      draggable: true,
      progress: undefined,
  }  );
    


    const {email, first_name,last_name, address, address2, phone, password} = formData

    

        return (
         
            <form onSubmit={handleSubmit}>
              <ToastContainer/>
              <h3>Sign Up</h3>
              <div className="mb-3">
                <label>Email</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="email"
                  id="email"
                  onChange={handleChange}
                  defaultValue={email}
                />
              </div>
              <div className="mb-3">
                <label>First name</label>
                <input onChange={handleChange} type="text" className="form-control"  defaultValue={first_name} placeholder="Last name" id="first_name"/>
              </div>
              <div className="mb-3"> 
                <label>Last name</label>
                <input
                  onChange={handleChange}
                  defaultValue={last_name}
                  type="last_name"
                  className="form-control"
                  placeholder="Enter email"
                  id="last_name"
                />
              </div>
              <div className="mb-3">
                <label>Address</label>
                <input
                  onChange={handleChange}
                  defaultValue={address}
                  type="address"
                  className="form-control"
                  placeholder="Enter password"
                  id="address"
                />
              </div>
              <div className="mb-3">
                <label>Address n°2</label>
                <input
                  onChange={handleChange}
                  defaultValue={address2}
                  type="address"
                  className="form-control"
                  placeholder="Enter password"
                  id="address2"
                />
              </div>
              <div className="mb-3">
                <label>Phone</label>
                <input
                  onChange={handleChange}
                  defaultValue={phone}
                  type="password"
                  className="form-control"
                  placeholder="Enter password"
                  id="phone"
                />
              </div>
              <div className="mb-3">
                <label>Password</label>
                <input
                  defaultValue={password}
                  onChange={handleChange}
                  type="password"
                  className="form-control"
                  placeholder="Enter password"
                  id="password"
                />
              </div>
              <div className="d-grid">
                <button onClick={() => sendWelcomeMsg('Bienvenue')}type="submit" className="btn btn-primary">
                  Sign Up
                </button>
              </div>
              <p className="forgot-password text-right">
                Already registered <a href="/sign-in">sign in?</a>
              </p>
            </form>
       
              
      

    )
}
export default Registration
